    2, 2009, please note the folllowing:                                                                                             1)
    With respect to Schedule A?s aggregate year-to-date totals for contributions received
    from individuals, please note that those individuals with a year-to-date aggregate
    of zero had been issued refunds during the reporting period.  Hence, their aggregate
    year-to-date total reflects the net result.  2) Any contribution that was incompletely
    or incorrectly disclosed has since been corrected on the amended February Monthly
    Report. The Committee has taken all steps to insure that contributors used permissible
    funds to make the contributions.    3) The Committee uses best efforts when trying
    to obtain all necessary information from an individual.  Contributions received
    in an excess of $200 have been corrected to report all the required information.
