    have been amended to clear this matter up.  5) Those refunds or rebates that were
    received and had been previously disclosed as allocable expenses have been corrected
    on the amended February Monthly Report and are disclosed on Schedule H4.  6) The
    report has been amended to disclose a corrected Schedule D.  7) The disbursements
    on Schedule H4 supporting Line 21(a) for Dental Insurance, Payroll Taxes and Salary
